-- ****************************************************************************************
-- * Script que crea y carga datos en las tablas boliches, clubes, cines y polideportivos *
-- ****************************************************************************************

-- Creo la extensión para PostGIS en la base de datos

CREATE EXTENSION postgis;


-- ******************
-- ** Tabla clubes **
-- ******************

CREATE TABLE public.clubes
(
    id integer,
    geom geometry,
    nombre character varying(254),
    direccion character varying(254),
    barrio character varying(254),
    comuna character varying(254),
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.clubes
    OWNER to postgres;
	



-- ********************
-- ** Tabla boliches **
-- ********************


CREATE TABLE public.boliches
(
    id integer,
    geom geometry,
    longitud double precision,
    latitud double precision,
    nombre character varying,
    direccion_normalizada character varying,
    capacidad character varying,
    barrio character varying,
    comuna character varying,
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.boliches
    OWNER to postgres;



-- *****************
-- ** Tabla cines **
-- *****************


CREATE TABLE public.cines
(
    id integer,
    geom geometry,
    nombre character varying(254),
    direccion character varying(254),
    barrio character varying(254),
    comuna character varying(254),
    capacidad double precision,
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.cines
    OWNER to postgres;
	




-- **************************
-- ** Tabla polideportivos **
-- **************************

CREATE TABLE public.polideportivos
(
    id integer,
    geom geometry,
    nombre character varying(254),
    direccion character varying(254),
    barrio character varying(254),
    comuna integer,
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.polideportivos
    OWNER to postgres;
	

	